  "application": "Slurm",
  "details": {
    "resource_requirements": {
      "nodes": 1,
      "tasks_per_node": 64,
      "cpus_per_task": 1,
      "memory": "256G",
      "time": "0-02:00:00",
      "partition": "short",
      "constraint": "intel"
    },
    "software_requirements": {
      "modules": [
        "singularity",
        "parallel"
      ],
      "image": "singularity/image.sif",
      "tools": [
        "make",
        "mkdir"
      ]
    },
    "parallel_options": {
      "parallel_arguments": "-k -N 1 --delay .2 -j 1 --joblog $1.parallel_joblog --resume",
      "parallel_description": "parallel runs the script concurrently on allocated CPUs, with a delay to prevent overloading the controlling node."
    },
    "srun_options": {
      "srun_arguments": "-n1 -N1 --exclusive",
      "srun_description": "srun ensures each task runs on distinct CPUs."
    },
    "script_description": "The script runs benchmarks defined in a list of arguments, using singularity container and parallel execution."
  }
}
